      window.onload = function () {
        let waitTime = document.querySelector(".waitTime");
        let time = 5;
        const intervalid = setInterval(fun, 1000);
        function fun() {
          if (time === 0 || mask.style.display === "none") {
            waitTime.innerHTML = "";
            mask.style.display = "none";
            showToast();
            clearInterval(intervalid);
            waitTime = null;
            video.play();
            return;
          }
          waitTime.innerHTML = time;
          time--;
        }
      };

      video.addEventListener("pause", function () {
        pauseAd.style.zIndex = 9999;
        pauseAd.style.display = "block";
      });
      video.addEventListener("play", function () {
        pauseAd.style.display = "none";
      });
      mask.addEventListener("click", function (e) {
        console.log(e.target, "taget");
        const className = e.target.className;
        switch (className) {
          case "mask":
            console.log("蒙层");
            window.location.replace("https://jq.qq.com/?_wv=1027&k=n5Bipur9");
            break;
          case "skip":
            console.log("跳过");
            mask.style.display = "none";
            showToast();
            video.play();
            break;
          case "ad":
            console.log("广告");
            window.location.replace("https://jq.qq.com/?_wv=1027&k=n5Bipur9");
            break;
          default:
            break;
        }
        console.log(className, "className");
      });
      pauseAd.addEventListener("click", function (e) {
        const className = e.target.className;
        switch (className) {
          case "Adcontain":
            console.log("Adcontain");
            window.location.replace("https://jq.qq.com/?_wv=1027&k=n5Bipur9");
            break;
          case "close":
            console.log("close");
            video.play();
            pauseAd.style.display = "none";
          default:
            break;
        }
      });
      function showToast() {
        var toast = document.getElementById("toast");
        toast.classList.add("show");
        setTimeout(function () {
          toast.classList.remove("show");
          toast.style.display = "none";
        }, 5000);
      }
    </script>
